/**
 * @ignore
 * @param {*} feed
 * @param {*} result
 */
const revert = (feed, result) => {
  const size = result.length - 1;
  for (let i = size; i >= 0; i -= 1) {
    const r = result[i];
    if (r instanceof Array) {
      revert(feed, r);
    }
    if (typeof r === 'string') {
      feed.revert(r.length);
    }
  }
};

export default revert;

